var title_f40_2_41002="Collagenous colitis Light I";
var content_f40_2_41002=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F60570%7EGAST%2F74390&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F60570%7EGAST%2F74390&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1108px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Collagenous colitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 434px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power view of a colonic biopsy from a patient with collagenous colitis. There is a thickened subepithelial collagenous band (arrow) associated with increased mononuclear cell infiltration and epithelial degeneration.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Normal colon",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 518px; height: 172px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low (left) and high (right) power views of a biopsy of a normal colon. Low power reveals straight crypts and mild lamina propria mononuclear cell infiltration. High power shows the surface enterocytes with interspersed goblet cells (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1119px;\">",
"  <div class=\"figure\" style=\"width: 481px\">",
"   <div class=\"ttl\">",
"    Collagenous colitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 461px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of a colonic biopsy from a patient with collagenous colitis. The characteristic change is thickened subepithelial collagenous band in the colonic mucosa that stains in bright blue (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Prof Dr G Herrmann, Frankfurt.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 518px\">",
"   <div class=\"ttl\">",
"    Normal colon",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 518px; height: 172px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low (left) and high (right) power views of a biopsy of a normal colon. Low power reveals straight crypts and mild lamina propria mononuclear cell infiltration. High power shows the surface enterocytes with interspersed goblet cells (arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
